{
  "ubx_message": {
    "name": "UBX-RXM-RTCM",
    "class_id": "0x02",
    "message_id": "0x32",
    "message_type": "output",
    "description": "This message shows info on a received RTCM input message. It is output upon successful parsing of an RTCM input message, irrespective of whether the RTCM message is supported or not by the receiver.",
    "payload_length": {
      "fixed": 8
    },
    "fields": [
      {
        "byte_offset": 0,
        "data_type": "U1",
        "name": "version",
        "description": "Message version (0x02 for this version)",
        "fixed_value": 2
      },
      {
        "byte_offset": 1,
        "data_type": "X1",
        "name": "flags",
        "description": "RTCM input status flags. Bit 0 (U:1) crcFailed: 0 when RTCM message received and passed CRC check, 1 when failed, in which case refStation and msgType might be corrupted and misleading. Bits 2..1 (U:2) msgUsed: 2 = RTCM message used successfully by the receiver, 1 = not used, 0 = do not know."
      },
      {
        "byte_offset": 2,
        "data_type": "U2",
        "name": "subType",
        "description": "Message subtype, only applicable to u-blox proprietary RTCM message 4072 (not available on all products)"
      },
      {
        "byte_offset": 4,
        "data_type": "U2",
        "name": "refStation",
        "description": "Reference station ID: For RTCM 2.3: Reference station ID of the received RTCM 2 input message. Valid range 0-1023. For RTCM 3.3: Reference station ID (DF003) of the received RTCM input message. Valid range 0-4095. Reported only for the standard RTCM messages that include the DF003 field and for the u-blox proprietary RTCM messages 4072.x. For all other messages, reports 0xFFFF."
      },
      {
        "byte_offset": 6,
        "data_type": "U2",
        "name": "msgType",
        "description": "Message type"
      }
    ]
  }
}
